column8:
特長<br>
　接着剤いらずの置き敷き塩ビタイル、ジーロックフローリングがモデルチェンジしました。<br>
　★釘・接着剤不要<br>
　　・長辺部分を差込み、短辺部分は落とし込むだけの簡単施工<br>
　　・DIY向け商品（賃貸物件にもお薦めです）<br><br>
■寸法：厚さ4mm × 働き幅185mm × 長さ1212mm<br>
　　　(※働き幅・長さは、実(サネ)部分を除いたサイズです)<br>
■入数： 8枚入／1梱包(1.79平米)<br>
■材質 ： PVC (塩ビ)<br>
■仕上げ： 特殊フィルムシート　エンボス加工<br>
■実加工： 四方実 (特殊実加工)<br>
ホルムアルデヒド放散量　不検出<br>
F☆☆☆☆　(告示対象外)<br><br>
※施工説明書をよくご確認ください。<br>
<br>
<p class="rd">●メーカー直送品です。お時間の指定はできません。代金引換には対応しておりません。<br>
●欠品時は納期がかかる場合がございます。<br>●返品交換等お受けできませんのであらかじめご了承ください。<br>●北海道、沖縄県、離島への発送の際は送料別途お見積りとなります。<br>※送料等変更のある場合は、訂正した金額をメールにてお伝えしますので必ずご確認くださいます様お願い致します。</p><p>※画像はイメージです。実際のお色と違って見える場合があります。予めサンプル等でご確認いただくことをお勧めします。なお、サンプルの取り寄せには少々お時間がかかる場合がありますのでご了承ください。</p>

